var playerIntroduce = '<p><font face="Arial"><font face="Arial"><strong>球员简介：</strong> <br />　　洛里斯是近年来崛起的法国门将，目前效力法甲的里昂，他曾获得法甲联赛年度最佳守门员奖。<br />　　洛里斯在家乡俱乐部尼斯开始职业生涯，在三个赛季的预备队生涯后，他被提拔进一队，并很快取得主力位置。在尼斯，他的优异表现吸引了大俱乐部的关注，08年里昂将他召入帐下，如今，他已经是法国国家队的主力门将。<br />技术特点<br />　　洛里斯并不是1米90以上的高大型门将，但他有着自己的特别之处，那就是反应和扑救的速度。<br />　　在近年来的里昂以及法国国家队比赛中，洛里斯尤其擅长化解单刀球和一对一射门，良好的选位和反应帮助他一次次化解看似必进的进球，在欧冠对利物浦的小组赛以及世界杯预选赛法国对爱尔兰的关键战中，洛里斯的神奇表现令人惊叹。 </font></font></p>';
